import React from 'react';
import { Navigate } from 'react-router-dom';

const ProtectedRoute = (props: { allowedRoles: string | any[]; userRole: any; element: any; }) => {
    return props.allowedRoles.includes(props.userRole) ? props.element : <Navigate to="/login" />;
};

export default ProtectedRoute;
